Yes Bryan - I have had messages take as long as 4 to 5 hours to come through
and others get caught in my spam filter.  I don&#39;t&#39; know why but it does
happen.

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Bryan Whatley
Sent: Saturday, April 05, 2008 4:04 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Just wondering if others emails are lost



Hi all,
  I was just wondering if others have sent email messages through to the
group but they never get through, or they seem to take a very long time for
it to come through. 
Thanks,
Bryan



  _____  

